export default function UpcomingEvents({ events }) {
  return (
    <section>
      <h2>Upcoming Events</h2>
      <ul>
        {events.map((event, idx) => (
          <li key={idx}>
            <strong>{event.title}</strong>: {new Date(event.date).toLocaleDateString()}
          </li>
        ))}
      </ul>
    </section>
  );
}
